import React from 'react'
import { useParams } from 'react-router-dom'
import posts from 'json/posts.json'

const Post = () => {
  const params = useParams()

  const post = posts.find((post) => {
    return post.id === Stringparams.id
  })

  return (
    <div>
      <h1>Post {params.id}</h1>
    </div>
  )
}

export default Post
